import React from 'react';
import '../App.css';

function ProfilePage() {
  return (
    <div className='profileBg'>
      <h1>Onni Raappana</h1>
      <div className='occupation'>
        <p>Software developer</p>
      </div>
    </div>
  );
}

export default ProfilePage;
